%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II (\u043a\u043e\u0440\u043e\u043b\u044c \u041f\u0440\u0443\u0441\u0441\u0438\u0438)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II<\/a> \u0441 \u0448\u0435\u0441\u0442\u0438\u0434\u0435\u0441\u044f\u0442\u0438\u0442\u044b\u0441\u044f\u0447\u043d\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439 \u0432\u0442\u043e\u0440\u0433\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D0%B8%D1%8F_(%D0%BA%D1%83%D1%80%D1%84%D1%8E%D1%80%D1%88%D0%B5%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u0421\u0430\u043a\u0441\u043e\u043d\u0438\u044f (\u043a\u0443\u0440\u0444\u044e\u0440\u0448\u0435\u0441\u0442\u0432\u043e)\">\u0421\u0430\u043a\u0441\u043e\u043d\u0438\u044e<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BC%D0%B8%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1756_%D0%B3%D0%BE%D0%B4\" title=\"1756 \u0433\u043e\u0434\">1756<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1763_%D0%B3%D0%BE%D0%B4\" title=\"1763 \u0433\u043e\u0434\">1763<\/a> \u0433\u0433.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1758_%D0%B3%D0%BE%D0%B4\" title=\"1758 \u0433\u043e\u0434\">1758<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D0%B8\" title=\"\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438\">\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438<\/a> \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B5%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B7%D0%B5%D1%80%D0%B2%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0435\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0437\u0435\u0440\u0432\u0430\u0446\u0438\u044f\">\u0438\u043d\u0434\u0435\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0437\u0435\u0440\u0432\u0430\u0446\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1782_%D0%B3%D0%BE%D0%B4\" title=\"1782 \u0433\u043e\u0434\">1782<\/a>&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u043b\u0438\u043d\u0435\u0439\u043d\u044b\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/HMS_Royal_George_(1756)\" title=\"HMS Royal George (1756)\">\u00ab\u0420\u043e\u0439\u0430\u043b \u0414\u0436\u043e\u0440\u0434\u0436\u00bb<\/a> \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u043d\u0430 \u0440\u0435\u0439\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%81%D0%BC%D1%83%D1%82\" class=\"mw-redirect\" title=\"\u041f\u043e\u0440\u0442\u0441\u043c\u0443\u0442\">\u041f\u043e\u0440\u0442\u0441\u043c\u0443\u0442\u0430<\/a>. \u0418\u0437 1200 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u0431\u043e\u043b\u0435\u0435 \u0432\u043e\u0441\u044c\u043c\u0438\u0441\u043e\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1793_%D0%B3%D0%BE%D0%B4\" title=\"1793 \u0433\u043e\u0434\">1793<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BC%D0%B8%D0%BD%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0414\u043e\u043c\u0438\u043d\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0421\u0430\u043d\u0442\u043e-\u0414\u043e\u043c\u0438\u043d\u0433\u043e<\/a> \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0430\u0431\u0441\u0442\u0432\u043e\">\u0440\u0430\u0431\u0441\u0442\u0432\u043e<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1827_%D0%B3%D0%BE%D0%B4\" title=\"1827 \u0433\u043e\u0434\">1827<\/a>&#160;\u2014 \u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%88%D0%B0%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041e\u0448\u0430\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430\">\u041e\u0448\u0430\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1831_%D0%B3%D0%BE%D0%B4\" title=\"1831 \u0433\u043e\u0434\">1831<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D1%80%D0%B0%D0%B4%D0%B5%D0%B9,_%D0%9C%D0%B0%D0%B9%D0%BA%D0%BB\" title=\"\u0424\u0430\u0440\u0430\u0434\u0435\u0439, \u041c\u0430\u0439\u043a\u043b\">\u041c\u0430\u0439\u043a\u043b \u0424\u0430\u0440\u0430\u0434\u0435\u0439<\/a> \u043e\u0442\u043a\u0440\u044b\u043b \u044f\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BC%D0%B0%D0%B3%D0%BD%D0%B8%D1%82%D0%BD%D0%B0%D1%8F_%D0%B8%D0%BD%D0%B4%D1%83%D0%BA%D1%86%D0%B8%D1%8F\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043c\u0430\u0433\u043d\u0438\u0442\u043d\u0430\u044f \u0438\u043d\u0434\u0443\u043a\u0446\u0438\u044f\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043c\u0430\u0433\u043d\u0438\u0442\u043d\u043e\u0439 \u0438\u043d\u0434\u0443\u043a\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1842_%D0%B3%D0%BE%D0%B4\" title=\"1842 \u0433\u043e\u0434\">1842<\/a>&#160;\u2014 \u041d\u0430\u043d\u043a\u0438\u043d\u0441\u043a\u0438\u043c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u043c \u043c\u0435\u0436\u0434\u0443 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0435\u043c<\/a> \u043e\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%9E%D0%BF%D0%B8%D1%83%D0%BC%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u041e\u043f\u0438\u0443\u043c\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u0430\u044f \u041e\u043f\u0438\u0443\u043c\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>. \u041f\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0439<\/a> \u0443\u0441\u0442\u0443\u043f\u0438\u043b \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3\" title=\"\u0413\u043e\u043d\u043a\u043e\u043d\u0433\">\u0413\u043e\u043d\u043a\u043e\u043d\u0433<\/a> \u0438 \u043e\u0442\u043a\u0440\u044b\u043b \u0434\u043b\u044f \u0435\u0451 \u0441\u0443\u0434\u043e\u0432 \u043f\u044f\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82\" title=\"\u041f\u043e\u0440\u0442\">\u043f\u043e\u0440\u0442\u043e\u0432<\/a>, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0432\u044b\u043f\u043b\u0430\u0442\u0438\u043b 23 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0430 \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D0%B8%D0%B1%D1%83%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u043d\u0442\u0440\u0438\u0431\u0443\u0446\u0438\u044f\">\u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u043a\u043e\u043d\u0442\u0440\u0438\u0431\u0443\u0446\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870<\/a>&#160;\u2014 15-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BC%D0%B1%D0%BE,_%D0%96%D0%B0%D0%BD_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0_%D0%90%D1%80%D1%82%D1%8E%D1%80\" class=\"mw-redirect\" title=\"\u0420\u0435\u043c\u0431\u043e, \u0416\u0430\u043d \u041d\u0438\u043a\u043e\u043b\u0430 \u0410\u0440\u0442\u044e\u0440\">\u0410\u0440\u0442\u044e\u0440 \u0420\u0435\u043c\u0431\u043e<\/a> \u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u0434\u043e\u043c \u0438 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%80%D0%BB%D0%B5%D0%B2%D0%B8%D0%BB%D1%8C-%D0%9C%D0%B5%D0%B7%D1%8C%D0%B5%D1%80\" title=\"\u0428\u0430\u0440\u043b\u0435\u0432\u0438\u043b\u044c-\u041c\u0435\u0437\u044c\u0435\u0440\">\u0428\u0430\u0440\u043b\u0435\u0432\u0438\u043b\u044f<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1882_%D0%B3%D0%BE%D0%B4\" title=\"1882 \u0433\u043e\u0434\">1882<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u0431\u0435\u0434\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044e<\/a> \u0432 \u0438\u0433\u0440\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D0%BA%D0%B5%D1%82\" title=\"\u041a\u0440\u0438\u043a\u0435\u0442\">\u043a\u0440\u0438\u043a\u0435\u0442<\/a>; \u00abSporting Times\u00bb \u043f\u0443\u0431\u043b\u0438\u043a\u0443\u0435\u0442 \u00ab\u043d\u0435\u043a\u0440\u043e\u043b\u043e\u0433 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u043c\u0443 \u043a\u0440\u0438\u043a\u0435\u0442\u0443\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1883_%D0%B3%D0%BE%D0%B4\" title=\"1883 \u0433\u043e\u0434\">1883<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%82%D0%B0%D0%B2%D0%B0\" title=\"\u041e\u0442\u0442\u0430\u0432\u0430\">\u041e\u0442\u0442\u0430\u0432\u0435<\/a> \u0422\u043e\u043c\u0430\u0441 \u0410\u0445\u0435\u0440\u043d (Thomas Ahern) \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BB%D0%B8%D1%82%D0%B0\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u043b\u0438\u0442\u0430\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043f\u043b\u0438\u0442\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B7%D0%B5%D0%BB%D1%8C\" title=\"\u0411\u0430\u0437\u0435\u043b\u044c\">\u0411\u0430\u0437\u0435\u043b\u0435<\/a>, \u043d\u0430 I \u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BE%D0%BD%D0%B8%D1%81%D1%82\" class=\"mw-redirect\" title=\"\u0421\u0438\u043e\u043d\u0438\u0441\u0442\">\u0441\u0438\u043e\u043d\u0438\u0441\u0442\u0441\u043a\u043e\u043c<\/a> \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0435, \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0432\u0448\u0435\u043c \u0441 29 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/31_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0\" title=\"31 \u0430\u0432\u0433\u0443\u0441\u0442\u0430\">31 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a>, \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D1%86%D0%BB%D1%8C,_%D0%A2%D0%B5%D0%BE%D0%B4%D0%BE%D1%80\" title=\"\u0413\u0435\u0440\u0446\u043b\u044c, \u0422\u0435\u043e\u0434\u043e\u0440\">\u0422\u0435\u043e\u0434\u043e\u0440\u0430 \u0413\u0435\u0440\u0446\u043b\u044f<\/a>, \u0431\u044b\u043b\u0430 \u0441\u043e\u0437\u0434\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D1%81%D0%B8%D0%BE%D0%BD%D0%B8%D1%81%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0441\u0438\u043e\u043d\u0438\u0441\u0442\u0441\u043a\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0441\u0438\u043e\u043d\u0438\u0441\u0442\u0441\u043a\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f<\/a>, \u043f\u0440\u0438\u043d\u044f\u0432\u0448\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B2%D0%B5%D0%B7%D0%B4%D0%B0_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%B0\" title=\"\u0417\u0432\u0435\u0437\u0434\u0430 \u0414\u0430\u0432\u0438\u0434\u0430\">\u0437\u0432\u0435\u0437\u0434\u0443 \u0414\u0430\u0432\u0438\u0434\u0430<\/a> \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0439 \u044d\u043c\u0431\u043b\u0435\u043c\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B3%D0%B0%D0%B9%D0%BE_(%D1%88%D1%82%D0%B0%D1%82)\" class=\"mw-redirect\" title=\"\u041e\u0433\u0430\u0439\u043e (\u0448\u0442\u0430\u0442)\">\u041e\u0433\u0430\u0439\u043e<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Goodyear_Tire_and_Rubber_Company\" title=\"Goodyear Tire and Rubber Company\">\u0413\u0443\u0434\u0438\u0435\u0440<\/a>\u00bb<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/III_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B\" class=\"mw-redirect\" title=\"III \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b\">III \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D1%82-%D0%9B%D1%83%D0%B8%D1%81\" title=\"\u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\">\u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\u0435<\/a>, \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%81%D1%81%D1%83%D1%80%D0%B8_(%D1%88%D1%82%D0%B0%D1%82)\" title=\"\u041c\u0438\u0441\u0441\u0443\u0440\u0438 (\u0448\u0442\u0430\u0442)\">\u041c\u0438\u0441\u0441\u0443\u0440\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u0432\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u0441\u043